import Admin from '../pages/admin/admim';
import Login from '../pages/login/login';
import { Navigate } from "react-router-dom"

const Routes = [
  {
    path: "/login",
    element: <Login />,

  },
  {
    path: "/admin",
    element: <Admin />
  },
  {
    path: "/",
    element: <Navigate to="/login" />
  },
]

export default Routes
